import React from 'react';
import { BsCurrencyDollar } from 'react-icons/bs';
import { FiDollarSign, FiUsers, FiBox, FiTrendingUp, FiRepeat } from "react-icons/fi";
import { GoDotFill } from 'react-icons/go';

import Sidebar from '../components/Sidebar';
import WidgetCard from "../components/Cards/WidgetCard";
import LineChart from "../components/charts/LineChart";
import BarChart from "../components/charts/BarChart";
import PieChart from "../components/charts/PieChart";
import AreaChart from "../components/charts/AreaChart";

import { useStateContext } from '../Context/ThemeContext';

import '../styles/Dashboard.css';

// Dummy earningData (replace with your real data)
const earningData = [
  {
    title: "Budget",
    amount: "$93,438",
    percentage: "+23%",
    icon: <BsCurrencyDollar />,
    iconColor: "#03C9D7",
    iconBg: "#E5FAFB",
    pcColor: "positive"
  },
  {
    title: "Expense",
    amount: "$48,487",
    percentage: "-12%",
    icon: <BsCurrencyDollar />,
    iconColor: "#FF5C8E",
    iconBg: "#FFE8F1",
    pcColor: "negative"
  }
];

const DropDown = ({ currentMode }) => (
  <div className="dropdown">
    <select
      id="time"
      style={{
        border: 'none',
        background: 'transparent',
        color: currentMode === 'Dark' ? 'white' : '#000'
      }}
      defaultValue="7days"
    >
      <option value="7days">Last 7 days</option>
      <option value="30days">Last 30 days</option>
      <option value="90days">Last 90 days</option>
    </select>
  </div>
);

const Dashboard = () => {
  const { currentColor, currentMode } = useStateContext();

  return (
    <div className="dashboard-layout">
      <Sidebar />

      <div className="dashboard-container">
        <h1 className="dashboard-title">Unified Admin Dashboard</h1>

        {/* Top Widgets */}
        <div className="scroll-container">
          <WidgetCard icon={<FiDollarSign />} label="Earnings" value="$63,448.78" buttonText="Download" />
          <WidgetCard icon={<FiUsers />} label="Customers" value="39,354" percentage="-4%" isNegative />
          <WidgetCard icon={<FiBox />} label="Products" value="4,396" percentage="+23%" />
          <WidgetCard icon={<FiTrendingUp />} label="Sales" value="423,39" percentage="+38%" />
          <WidgetCard icon={<FiRepeat />} label="Refunds" value="39,354" percentage="-12%" isNegative />
        </div>

        {/* Earnings Overview */}
        <div className="ecommerce-hero">
          <div className="earnings-card">
            <div className="earnings-content">
              <div>
                <p className="earnings-title">Earnings</p>
                <p className="earnings-amount">$63,448.78</p>
              </div>
              <button
                type="button"
                style={{ backgroundColor: currentColor }}
                className="earnings-icon"
              >
                <BsCurrencyDollar />
              </button>
            </div>
            <div className="earnings-btn">
              <button style={{ backgroundColor: currentColor }} className="btn-primary">Download</button>
            </div>
          </div>

          <div className="earning-cards">
            {earningData.map((item) => (
              <div key={item.title} className="earning-card">
                <button
                  type="button"
                  style={{ color: item.iconColor, backgroundColor: item.iconBg }}
                  className="earning-card-icon"
                >
                  {item.icon}
                </button>
                <p className="earning-card-amount">
                  {item.amount}
                  <span className={`earning-card-percentage ${item.pcColor}`}>{item.percentage}</span>
                </p>
                <p className="earning-card-title">{item.title}</p>
              </div>
            ))}
          </div>
        </div>

        {/* Charts */}
        <h2 className="section-title">Data Charts</h2>
        <div className="scroll-container">
          <div className="chart-card"><LineChart /></div>
          <div className="chart-card"><BarChart /></div>
          <div className="chart-card"><PieChart /></div>
          <div className="chart-card"><AreaChart /></div>
        </div>

        {/* Revenue Updates */}
        <h2 className="section-title">Revenue Updates</h2>
        <div className="scroll-container">
          <div className="revenue-card">
            <div className="revenue-header">
              <p className="revenue-title">Revenue</p>
              <div className="revenue-tags">
                <p className="revenue-expense"><GoDotFill /> Expense</p>
                <p className="revenue-budget"><GoDotFill /> Budget</p>
              </div>
            </div>
            {/* Optional: SparkLine or other charts */}
          </div>

          <div className="monthly-earnings" style={{ backgroundColor: currentColor }}>
            <p className="monthly-earnings-title">Earnings</p>
            <div className="monthly-amount">
              <p className="amount">$63,448.78</p>
              <p className="monthly-desc">Monthly revenue</p>
            </div>
          </div>
        </div>

        {/* Quick Stats */}
        <h2 className="section-title">Quick Stats</h2>
        <div className="grid-container">
          <div className="grid-card"><h3>New Users</h3><p>320 this week</p></div>
          <div className="grid-card"><h3>Pending Orders</h3><p>56 orders</p></div>
          <div className="grid-card"><h3>Revenue Growth</h3><p>+18% compared to last month</p></div>
          <div className="grid-card"><h3>Refund Requests</h3><p>12 pending</p></div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
